body.script:
function $(selector, node){
    var elements;

    node = node || document;
    if(document.querySelectorAll){
        elements = node.querySelectorAll(selector);
    } else {
        switch(selector.substr(0, 1)){
            case '#':
                elements = [node.getElementById(selector.substr(1))];
                break;
            case '.':
                if(document.getElementsByClassName){
                    elements = node.getElementsByClassName(selector.substr(1));
                } else {
                    elements = get_elements_by_class(selector.substr(1), node);
                }
                break;
            default:
                elements = node.getElementsByTagName();
        }
    }
    return elements;

    function get_elements_by_class(search_class, node, tag) {
        var elements = [], eles, 
            pattern  = new RegExp('(^|\\s)' + search_class + '(\\s|$)');

        node = node || document;
        tag  = tag  || '*';

        eles = node.getElementsByTagName(tag);
        for(var i = 0; i < eles.length; i++) {
            if(pattern.test(eles[i].className)) {
                elements.push(eles[i])
            }
        }

        return elements;
    }
}

$.getScript = function(src, func){
    var script = document.createElement('script');

    script.async  = 'async';
    script.src    = src;
    script.onload = func || function(){};

    $('head')[0].appendChild(script);
}

;(function(){
    var files = $('.toggle');
    var ol    = $('ol', $('.prettyprint')[0]);
    var li    = $('li', ol[0]);   

    // 短路径和长路径变换
    for(var i = 0; i < files.length; i++){
        files[i].ondblclick = function(){
            var title = this.title;

            this.title = this.innerHTML;
            this.innerHTML = title;
        }
    }

    (function () {
        var expand = function (dom, expand) {
            var ol = $('ol', dom.parentNode)[0];
            expand = undefined === expand ? dom.attributes['data-expand'].value === '0' : undefined;
            if (expand) {
                dom.attributes['data-expand'].value = '1';
                ol.style.display = 'none';
                dom.innerText = 'Call Stack (展开)';
            } else {
                dom.attributes['data-expand'].value = '0';
                ol.style.display = 'block';
                dom.innerText = 'Call Stack (折叠)';
            }
        };
        var traces = $('.trace');
        for (var i = 0; i < traces.length; i ++) {
            var h2 = $('h2', traces[i])[0];
            expand(h2);
            h2.onclick = function () {
                expand(this);
            };
        }
    })();

    $.getScript('//cdn.bootcss.com/prettify/r298/prettify.min.js', function(){
        prettyPrint();
    });
})();

